webpackJsonp([0xf4d2f742b7db],{1289:function(e,a){e.exports={data:{site:{siteMetadata:{title:"Justin Ball",author:"Justin Ball"}},markdownRemark:{id:"/Users/jbasdf/projects/justinball/src/posts/2013-01-16-pearl-harbor/index.md absPath of file >>> MarkdownRemark",html:'<p>Sunday we visited Pearl Harbor. It\'s a sobering place. Of course I\'ve spent my life learning about the history, but a visit is very touching and helps remind you of the cost of the freedoms we take for granted.</p>\n<img class="scale-image" src="IMG_6188.jpg" />\n<p>Tears of the Arizona. About 500,000 gallons of oil remain.</p>\n<img class="scale-image" src="IMG_62031.jpg" />\n<p>Parts of the Arizona remain above the water.</p>\n<img class="scale-image" src="IMG_6202.jpg" />\n<p>The Missouri</p>\n<img class="scale-image" src="IMG_6199.jpg" />\n<p>A Japanese torpedo they found while dredging the bay (unexploaded). They examined it, then detonated it. Here\'s what remains:</p>\n<img class="scale-image" src="IMG_1644.jpg" />\n<p>We spent the evening along the shore in Ko Olina.</p>\n<img class="scale-image" src="IMG_1653.jpg" />\n<p>We\'re pretty happy to be here.</p>\n<img class="scale-image" src="IMG_1646.jpg" />',frontmatter:{title:"Pearl Harbor",date:"January 16, 2013",image:{childImageSharp:{sizes:{src:"/static/IMG_6188-3a6bfc0e504e5f2e96aa112c7ca02b73-381d6.jpg"}}}}}},pathContext:{path:"/pearl-harbor"}}}});
